const TemplateSchema = require("../models/template");
const UserSchema = require("../models/user")
const mammoth = require("mammoth");
const { PDFDocument } = require("pdf-lib");
const pdf = require("html-pdf");
const { default: mongoose } = require("mongoose");
const EmployeeSchema = require("../models/employee")

exports.createTemplate = async (req, res) => {
    try {
        const { templateName, mainTemplate, fields } = req.body;

        let finalData = {
            templateName,
            mainTemplate,
            fields,
        };

        const createTemplate = await TemplateSchema.create(finalData);

        return res.status(200).json({ data: createTemplate, success: true });
    } catch (error) {
        return res.status(400).json(error);
    }
};

exports.getTemplates = async (req, res) => {
    try {
        const { userId } = req
        const {
            page = 0,
            pageSize = 10,
            search,
        } = req.query;

        const userData = await UserSchema.findById(userId)

        const skip = page * pageSize;

        let findObject = { company: new mongoose.Types.ObjectId(userData.company) };

        if (search) {
            findObject.$or = [
                { templateName: { $regex: search.trim(), $options: "i" } },
            ];
        }

        const templates = await TemplateSchema.find(findObject).sort({ createdAt: -1 })
            .populate("company")
            .skip(skip)
            .limit(pageSize)
            .lean()
            .exec();

        const total = await TemplateSchema.countDocuments(findObject);

        return res.status(200).json({ data: templates, total, success: true });
    } catch (error) {
        return res.status(400).json(error);
    }
};

exports.findVarFromTemplateById = async (req, res) => {
    const { dId } = req.params;

    try {
        const docs = await TemplateSchema.findById(dId);

        const fileName = docs["docData"].replace(/\s/g, "");
        const pdfFile = fileName.split(".").slice(0, -1);

        const folderName = `${process.cwd()}\\DefaultDocs`;

        mammoth
            .extractRawText({ path: folderName + "\\" + docs["docData"] })
            .then(function (result) {
                var text = result.value.replace(/\s/g, "");

                const data = text.match(/{([^}]+)}/g);

                return res.status(200).json({ error: false, data: data });
            })
            .done();
    } catch (error) {
        return res.status(400).json({ error });
    }
};

