const convertHtmlToPdfForHR = async (htmlContent) => {
    try {
        let options = {
            format: "Letter",
            header: {
                height: "1.15in",
            },
            footer: {
                height: "1in",
            },
            childProcessOptions: {
                env: {
                    OPENSSL_CONF: "/dev/null",
                },
            },
        };
        return new Promise((resolve, reject) => {
            pdf.create(htmlContent, options).toBuffer(function (err, buffer) {
                if (err) reject(err);
                // const base64PDF = base64.fromByteArray(buffer);
                resolve(buffer);
            });
        });
    } catch (error) {
        console.log(error, "convertHtmlToPdfForHR error===============");
    }
};

const mergeStampAndBase64ToPdfForHR = async (base64Buffer) => {
    try {
        const imageBuffer = Buffer.from(
            "",
            "base64"
        );

        // Load the PDF document from base64
        const base64Pdf = await PDFDocument.load(base64Buffer);

        // Create a new PDF document
        const mergedPdf = await PDFDocument.create();

        // Add a page for the image
        let imagePage;
        const image = await mergedPdf.embedPng(imageBuffer);
        const imageSize = image.scale(0.028);

        // Add pages from the base64 PDF
        const base64Pages = await mergedPdf.copyPages(
            base64Pdf,
            base64Pdf.getPageIndices()
        );

        base64Pages.forEach((base64Page) => {
            imagePage = mergedPdf.addPage(base64Page);

            imagePage.drawImage(image, {
                x: 475,
                y: 705,
                width: imageSize.width,
                height: imageSize.height,
            });
        });

        // Return the base64-encoded PDF content
        return await mergedPdf.saveAsBase64();
    } catch (error) {
        console.log(error, "mergeStampAndBase64ToPdfForHR error===============");
    }
};

exports.htmlToPdf = async (req, res, data, document) => {
    try {

        const replacementMap = {
            "{empName}": "{name}",
            "{Designation}": "{designation}",
            "{Salary}": "{salary}",
            "{Salary_PA}": "{salaryPa}",
            "{Basic_Salary}": "{basicSalary}",
            "{Basic_Salary_PA}": "{basicSalaryPa}",
            "{Allowances}": "{allowances}",
            "{Allowances_PA}": "{allowancesPa}",
            "{Education_Allowance}": "{educationAllowance}",
            "{Education_Allowance_PA}": "{educationAllowancePa}",
            "{Attendance_Allowance}": "{attendanceAllowance}",
            "{Attendance_Allowance_PA}": "{attendanceAllowancePa}",
            "{HRA}": "{hra}",
            "{HRA_PA}": "{hraPa}",
            "{Monthly_Bonus}": "{monthlyBonus}",
            "{Monthly_Bonus_PA}": "{monthlyBonusPa}",
            "{Production_Incentive}": "{productionIncentive}",
            "{Production_Incentive_PA}": "{productionIncentivePa}",
            "{Gross_Salary_I_II}": "{Gross_Salary_I_II}",
            "{Gross_Salary_I_II_PA}": "{Gross_Salary_I_II_PA}",
            "{Company_Contribution}": "{companyContribution}",
            "{Company_Contribution_PA}": "{companyContributionPa}",
            "{Provident_Fund}": "{providentFund}",
            "{Provident_Fund_PA}": "{providentFundPa}",
            "{Provident_Fund_PA}": "{providentFundPa}",
            "{Employee_State_Insurance_Corporation}": "{employeeStateInsuranceCorporation}",
            "{Employee_State_Insurance_Corporation_PA}": "{employeeStateInsuranceCorporationPa}",
            "{Bonus_Exgratia}": "{bonusExgratia}",
            "{Bonus_Exgratia_PA}": "{bonusExgratiaPa}",
            "{Fixed_CTC_I_II_III_IV}": "{Fixed_CTC_I_II_III_IV}",
            "{Fixed_CTC_PA_I_II_III_PA}": "{Fixed_CTC_PA_I_II_III_PA}",
            "{Variable_Pay}": "{variablePay}",
            "{Variable_Pay_PA}": "{variablePayPa}",
            "{Total_CTC}": "{totalCTC}",
            "{Total_CTC_PA}": "{totalCTCPa}",
            "{Residential_Address}": "{residentialAddress}",
            "{Notice_Period}": "{noticePeriod}",
        };

        const findEmployeeData = await EmployeeSchema.findOne({
            empCode: data.empCode,
        });

        let fieldsData = document.fields
        let htmlData = document.htmlTemplate

        fieldsData.forEach((element) => {
            let getTempVar = element;
            let newTempVar = replacementMap[getTempVar];

            let combineObject = {
                ...findEmployeeData._doc,
            };

            if (newTempVar !== undefined) {
                let changeData = newTempVar.replace("{", "").replace("}", "");

                htmlData = htmlData.replaceAll(
                    element,
                    combineObject[changeData] == undefined ||
                        combineObject[changeData] == ""
                        ? element
                        : combineObject[changeData]
                );
            } else {
                htmlData = htmlData.replaceAll(element, getTempVar);
            }

            // if (getTempVar !== undefined) {
            //     let changeData = getTempVar.replace("{", "").replace("}", "");

            //     console.log(combineObject, "combineObject=========");
            //     // console.log(changeData, "changeData=========");


            //     htmlData = htmlData.replaceAll(
            //         element,
            //         combineObject[changeData] == undefined ||
            //             combineObject[changeData] == ""
            //             ? element
            //             : combineObject[changeData]
            //     );
            // } else {
            //     htmlData = htmlData.replaceAll(element, getTempVar);
            // }
        });

        let removeMergeField = htmlData?.replaceAll(/MERGEFIELD\s+\w+\s*/g, "");

        const htmlContent = `
      <html>
        <head>
          <style>
            * {
              margin: 0;
              padding: 0;
              box-sizing: border-box;
            }
            body {
              width: 100%;
              overflow: auto;
              word-wrap: break-word;
            }
          </style>
        </head>
        <body>
          ${removeMergeField}
        </body>
      </html>
    `;

        if (!htmlData) {
            return res.status(400).json({ error: "htmlContent is required" });
        }

        const pdfBuffer = await convertHtmlToPdfForHR(htmlContent);

        let finalBase64;
        let stamp = "yes"

        if (stamp == "yes") {
            finalBase64 = await mergeStampAndBase64ToPdfForHR(pdfBuffer);
        } else {
            finalBase64 = pdfBuffer.toString("base64");
        }

        // res.setHeader("Content-Type", "application/pdf");
        // res.setHeader("Content-Disposition", "attachment; filename=output.pdf");


        return finalBase64
    } catch (error) {
        return res.status(400).json(error);
    }
};

exports.getTemplateById = async (req, res) => {
    try {
        const { id } = req.params;

        let templateData = await TemplateSchema.findById(id).populate("company").lean().exec();

        return res.status(200).json({ success: true, data: templateData });
    } catch (error) {
        console.log(error);
    }
};

exports.searchTemplates = async (req, res) => {
    try {
        const { userId } = req
        const { search } = req.body;
        const limit = 5;

        const userData = await UserSchema.findById(userId)

        // for searching
        let findObject = { company: new mongoose.Types.ObjectId(userData.company) };
        if (search) {
            findObject.$or = [
                { templateName: { $regex: search.trim(), $options: "i" } },
            ];
        }

        const templateData = await TemplateSchema.find(findObject)
            .sort({
                createdAt: -1,
            })
            .limit(limit)
            .lean()
            .exec();

        return res.status(200).json({
            error: false,
            data: templateData,
        });
    } catch (error) {
        return res.status(400).json({ error: true, message: error.message });
    }
};

exports.updateTemplate = async (req, res) => {
    try {
        const { id } = req.params;
        const { templateName, mainTemplate, fields } = req.body;

        let finalData = {
            templateName,
            mainTemplate,
            fields,
        };

        const updatedEmployee = await TemplateSchema.findByIdAndUpdate(id, finalData, { new: true });

        return res.status(200).json({
            data: updatedEmployee,
            message: "Template updated successfully",
            error: false,
        });

    } catch (error) {
        return res.status(400).json({ error: error.message });
    }
}